<p>Auscultation cardio-pulmonaire normale<br />Abdomen souple, non distendu<br />Pas d'éruption cutanée - coloration normale<br />Pas d'adénopathie<br />Pas de trouble de la vision ni de l'audition<br />Pas de trouble de l'équilibre ni autre trouble  neurologique</p>
